import React from 'react'
import Paper from '@material-ui/core/Paper';
import {
ArgumentAxis,
ValueAxis,
Chart,
LineSeries,
} from '@devexpress/dx-react-chart-material-ui';

const LineChart = () => {
    const data = [
        { x: 1, y: 3 },
        { x: 2, y: 4 },
        { x: 3, y: 5 },
        { x: 4, y: 2 },
        { x: 5, y: 1 },
        ];
  return (
    <div>
          <Paper className="chart">
	<Chart
	data={data}
	>
	<ArgumentAxis />
	<ValueAxis />

	<LineSeries valueField="y" argumentField="x" />
	</Chart>
</Paper>
    </div>
  )
}

export default LineChart
